import { Component } from "./Component";
import { useGlobalContext } from "./context";
// import "./index.css";
const AllComponents = () => {
  const add = (e) => {
    e.preventDefault();
    return <Component name="e.target.input.value" />;
  };
  return (
    <section>
      <table>
        <tr>
          <th>to do</th>
          <th>doing</th>
          <th>done</th>
        </tr>
        <tr>
          <Component name="todo" />
          <Component name="doing" />
          <Component name="done" />
          {
            <>
              <form
                onSubmit={(e) => {
                  e.preventDefault();
                  return <Component name={e.target.input.value} />;
                }}
              >
                <input name="input" type="text" />
                <button type="submit"> Add coloumn</button>
              </form>
            </>
          }
        </tr>
      </table>
    </section>
  );
};

export default AllComponents;
